import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <nav>
        <ul>
          <li>Home</li>
          <li>Streams</li>
          <li className="active">Game Store</li>
          <li>News</li>
        </ul>
      </nav>
      <div className="icons">
        <i className="fa fa-shopping-cart"></i>
        <i className="fa fa-user"></i>
      </div>
    </header>
  );
}

export default Header;
